--
-- Procedures
--
CREATE DEFINER=`root`@`localhost` PROCEDURE `blacklisted`(IN idbl int)
BEGIN
	
	SELECT a.rkn_id, b.user, b.name, b.rkn_npwp, b.rkn_alamat 
	FROM blacklist a LEFT JOIN auth_login b ON a.rkn_id = b.rkn_id
	WHERE a.id_daftarhitam = idbl AND a.status = 1;
    END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `cronSPSE`(IN rekanid INT)
BEGIN
	SELECT a.rkn_id 
	FROM blacklist a INNER JOIN daftar_hitam b ON a.id_daftarhitam = b.id
	WHERE a.rkn_id = rekanid AND a.status = 1 
	and CURDATE() between b.tgl_berlaku and b.tgl_penayangan;
    END$$

DELIMITER ;

