INSERT INTO `contents` (`id`, `title`, `content`, `title_ind`, `content_ind`, `title_ita`, `content_ita`, `file_image`, `type`, `publish`, `featured`, `ordered`, `user_id`, `modify_user_id`, `modify_date`, `create_date`) VALUES
(13, 'Tentang Kami', '<section class="slice no-padding mt-20">\r\n<div class="work">\r\n<div class="row">\r\n<div class="col-md-12 text-center">&nbsp;</div>\r\n</div>\r\n</div>\r\n</section>\r\n\r\n<p style="text-align: justify;"><span style="font-size:14px;">INAPROC - Portal Pengadaan Nasional adalah pintu gerbang sistem informasi elektronik yang terkait dengan informasi Pengadaan Barang/Jasa secara nasional yang dibangun dan dikelola oleh Lembaga Kebijakan Pengadaan Barang/Jasa Pemerintah - Republik Indonesia.</span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:14px;">Portal ini menjadi tempat penayangan rencana pengadaan dan pengumuman pengadaan oleh Kementerian, Lembaga, Pemerintah Daerah, dan Instansi. Disamping itu, portal ini memuat atau memberi akses dan tautan kepada seluruh Layanan Pengadaan Secara Elektronik, Katalog Barang untuk E-Purchasing, dan Daftar Hitam Penyedia Barang/Jasa. Portal ini juga dilengkapi dengan mesin pencari (search engine) pengumuman lelang yang sedang aktif/berjalan.</span><br />\r\n&nbsp;</p>\r\n\r\n<div class="row">\r\n<div class="col-md-6 col-xs-12"><img alt="" src="/ck_uploads/uploads/images/garuda-lkpp(1).jpg" style="color: rgb(97, 97, 97); font-family: ''PT Sans'', sans-serif; font-size: 13px; line-height: 22px; width: 368px; height: 130px;" /></div>\r\n\r\n<div class="col-md-6 col-xs-12 pull-right footer-about">\r\n<p class="text-right"><strong>Lembaga Kebijakan Pengadaan Barang/Jasa Pemerintah</strong></p>\r\n\r\n<p class="text-right"><strong>Gedung SMESCO UKM, Lt. 7,8,9 dan 17 Jl. Jend. Gatot Subroto Kav. 94</strong></p>\r\n\r\n<p class="text-right"><strong>Jakarta Selatan - 12780 Telepon: 021 - 7991025</strong></p>\r\n\r\n<p class="text-right"><strong>Fax: 021 - 7991025 / 021 - 7991086</strong></p>\r\n\r\n<p class="text-right"><strong>Call Center: 021 - 7991025 / 021 - 7991077</strong></p>\r\n</div>\r\n</div>\r\n', '', '', '', '', '', '', 'Publish', 'No', 0, 1, 1, '2014-11-18 12:30:22', '2014-08-30 17:36:53');
