(17, 2, 'LKPP Terima 1.000 Aduan dari Masyarakat', '<p style="text-align: justify;"><span style="font-size:14px;">Lembaga Kebijakan Pengadaan Barang atau Jasa Pemerintah (LKPP) menerima 1.000 pengaduan dari masyarakat dalam sebulan. Pengaduan yang diterima biasa mengenai kasus yang ganjil dalam pengadaan barang dan jasa yang dijalankan oleh pemerintah.</span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:14px;">Direktur Pengembangan Sistem Pengadaan Secara Elektronik LKPP, Tatang Rustandar Wiraatmaja mengatakan, ada 1.000 laporan yang diadukan oleh masyarakat, namun semua laporan itu tidak semuanya benar.</span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:14px;">&quot;Kita terima 1.000 laporan dari masyarakat, namun semuanya tidak benar. Tapi kita tindak lanjuti semua laporan itu,&quot; ujar Tatang ketika ditemui dalam diskusi membedah permasalahan pengadaan barang dan jasa di Hotel Bidakara, Jakarta, Senin (2/12/2013).</span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:14px;">Menurut Tatang, adapun pengaduan yang diajukan oleh masyarakat bentuknya mulai dari proyek fiktif dan proyek yang sudah diatur.<br />\r\nJadi LKPP sangat sudah mengetahui pemenang tendernya. Itu yang sudah terjadi dalam pengadaan barang dan jasa yang dilakukan oleh pemerintah.</span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:14px;">Jika tingkat kebenaran pengaduannya nyata, maka proyek fiktif yang didapatkan pengaduannya dari masyarakat bisa ditindak dengan cepat oleh penegak hukum seperti Komisi Pemberantasan Korupsi (KPK).</span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:14px;">&quot;Bentunya pengaduan, namun setelah itu kita audit forensik. Kalau sudah di audit maka kita klarifikasi ke pejabat. Terus setelah itu kita adukan ke KPK untuk menindaklanjuti aduan dari masyarakat tersebut,&quot; tegasnya.</span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:14px;">Selain itu, ia menjelaskan, dalam mengurangi tingkat kecurangan pengadaan barang dan jasa yang dilakkukan pemerintah. Diharapkan pemerintah melakukan lelang barang dan jasa secara elektronik, sehingga sikap transparansi (keterbukaa) bisa dipantau langsung oleh LKPP.</span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:14px;">&quot;Kalau pakai elektronik, maka kita bisa pantau langsung. Kalau sudah pake elektronik maka sikap transparansi akan ada, dan tidak akan terjadi lagi lelang-lelang yang tidak diinginkan,&quot; tutup Tatang.</span></p>\r\n', '', '', '', '', '', '', '', '', '20150126123956lkpp_1000_aduan.jpg', 0, '', 0, '0000-00-00', '0000-00-00 00:00:00', '', 'Publish', 0, '0000-00-00 00:00:00', 1, 1, '2015-01-26 11:39:56', '2014-09-01 18:46:19', 1),
(18, 1, 'Jokowi Pusing Banyak SKPD Belum Daftar Paket Pengadaan Barang ', '<p style="text-align: justify;"><span style="font-size:14px;">Gubernur DKI Jakarta Joko Widodo mengaku cukup kerepotan dengan sistem lelang pengadaan barang dan jasa -- yang saat ini terpadu -- di Unit Layanan Pengadaan (ULP) Barang Jasa DKI. Sebab, masih banyak Satuan Kerja Perangkat Daerah (SKPD) dan Unit Kerja Perangkat Daerah (UKPD) belum mengusulkan pengadaan ke ULP.</span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:14px;">&quot;Kita kejar-kejaran dengan pengadaan barang, pusing,&quot; ucap pria yang karib disapa Jokowi itu di Balaikota DKI Jakarta, Jumat (2/5/2014).</span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:14px;">Kendalanya, kata Jokowi, Anggaran Pendapatan dan Belanja Daerah (APBD) DKI 2014 baru disahkan DPRD Maret lalu. Sehingga, penyiapan administrasi di tiap SKPD baru disiapkan sebulan kemudian. Padahal, pengadaan barang dan jasa sebenarnya dapat berlangsung cepat, karena para SKPD cukup berpengalaman.</span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:14px;">&quot;Sekarang baru mulai, ini kejar-kejaran. Karena kita dibatasi waktu, makanya kta push terus, kita teken terus supaya bisa berjalan,&quot; ujar mantan Walikota Surakarta itu.</span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:14px;">Kepala ULP DKI Jakarta I Dewa Gede Soni mengatakan, sudah ada 62 SKPD dan UKPD yang mengusulkan 623 paket pengadaan lelang barang dan jasa, dari total 750 SKPD dan UKPD yang mendaftarkan lelang. Padahal Jokowi memberi waktu hingga 16 Mei 2014, bagi para SKPD dan UKPD mendaftarkan lelang mereka.</span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:14px;">Prosedurnya, lanjut Soni, setiap SKPD dan UKPD diharuskan memasukkan rencana umum pengadaan barang dan jasa melalui alamat laman www.ikpp.go.id. Agar masyarakat dan ULP dapat melihat berapa paket yang akan dibelanjakan Pemprov DKI. Penyusunan term of references atau kerangka acuan harus jelas dan detail.</span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:14px;">&lrm;Adapun beberapa SKPD dan UKPD yang telah mengusulkan lelang pengadaan barang dan jasa ke ULP, antara lain seperti Dinas Perumahan dan Gedung Pemda DKI, Dinas Pekerjaan Umum, Dinas Pariwisata dan Kebudayaan DKI, Dinas Tenaga Kerja dan Transmigrasi DKI, Suku Dinas Pekerjaan Umum Jakarta Barat, &lrm;UPT Monas, UP GOR Ragunan, dan lainnya.</span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:14px;">Semua lelang fisik yang anggarannya di atas Rp 200 juta dan lelang jasa di atas Rp 50 juta akan dilaksanakan melalui ULP. Namun, tidak semua barang dapat dibeli melalui ULP, karena sebagian besar pelelangan telah masuk di e-catalog dan e-purchasing. Apabila di kedua sistem online itu tidak tersedia, baru masing-masing SKPD dan UKPD melelang melalui ULP barang dan jasa.</span></p>\r\n', '', '', '', '', '', '', '', 'Agus', '20150126123857lkpp_jokowi_pusing.jpg', 0, '', 0, '0000-00-00', '0000-00-00 00:00:00', '', 'Publish', 0, '0000-00-00 00:00:00', 1, 1, '2015-01-26 11:39:02', '2014-09-01 18:47:14', 7),
(19, 2, 'Pemerintah Tingkatkan Sistem Elektronik untuk Pengadaan Barang', '<p style="text-align: justify;"><span style="font-size:14px;">Pelaksaan penggunaan Information and Communication Technology/ICT E-Procurement &nbsp;dapat terealisasi dengan baik pada pada 2019. Penggunaan ICT E-Procurement ini &nbsp;sebagai solusi pengadaan barang dan jasa yang memiliki tingkat transparansi &nbsp;tinggi.&nbsp;</span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:14px;">Direktur Pengadaan Secara Elektronik Lembaga Kebijakan Pengadaan Barang atau Jasa Pemerintah (LKPP), Tatang Rusnandar W menuturkan, ICT E-Procurement yaitu sistem yang dapat digunakan dalam melakukan semua proses pengadaan barang dan jasa.</span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:14px;">Proses itu mulai penawaran hingga pelaksanaan kontrak yang menggunakan sistem elektronik. Pelaksanaan ICT E-Procurement diharapkan dapat memiliki tingkat keterbukaan yang tinggi.</span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:14px;">&quot;Pelaksanaan ICT E-Procurement sudah dilaksanakan sejak lama sekitar tahun 2010. Kami harapkan pelaksanaan ICT E-Procurement bisa terlaksana dengan baik di tahun 2019, sehingga pengadaan barang bisa lebih terbuka, bersaing dan sehat. Itu yang kami harapkan,&quot; ujar Tatang &nbsp;ketika ditemui dalam diskusi membedah permasalahan pengadaan barang dan jasa di Hotel Bidakara, Jakarta, Senin (2/12/2013).</span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:14px;">Tatang menjelaskan, penggunaan sistem ICT E-Procurement mendorong pengadaan barang dan jasa dapat lebih mengedepankan sifat keterbukaan dan akuntabilitas.</span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:14px;">&quot;Ketika sikap transparansi sudah dijalankan, maka semua masyarakat bisa melakukan akses ke pasar yaitu bisa menjalankan pengadaan barang dan jasa lebih baik. Jangan ada lagi praktik-praktik korupsi dan kolusi yang terjadi ketika melakukan pengadaan barang dan jasa,&quot; tegasnya.</span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:14px;">Selain itu, ketika persaingan usaha sudah menjadi sehat, maka dapat memperbaiki tingkat efisiensi dan efektif dalam proses pengadaan barang dan jasa. Sehingga bisa mengurangi biaya setinggi mungkin.</span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:14px;">&quot;Kita juga ingin meningkatkan efisiensi dan efektif pengadaan barang dan jasa. Pengadaan barang dan jasa lebih banyak yang tidak mengedepankan sifat efisiensi, itu sangat tidak baik dalam melakukan pengadaan barang jasa,&quot; ungkap Tatang.</span></p>\r\n\r\n<p style="text-align: justify;"><span style="font-size:14px;">Lanjut Tatang, ketika menggunakan ICT E-Procurement tingkat kredibilitas dalam melakukan pengadaan barang dan jasa bisa lebih terjamin dan tingkat sumber daya manusia (SDM) bisa lebih ditingkatkan.</span></p>\r\n', '', '', '', '', '', '', '', 'Irwan', '20150126123751lkpp_elektronik.jpg', 0, '', 0, '0000-00-00', '0000-00-00 00:00:00', '', 'Publish', 0, '0000-00-00 00:00:00', 1, 1, '2015-01-26 11:39:21', '2014-10-01 09:10:21', 35),
(20, 1, 'Kejaksaan belum sentuh otak kasus transjakarta', '<p>JAKARTA. Ketua Forum Warga Kota Jakarta (FAKTA) Azas Tigor Nainggolan mengaku tidak puas terhadap penetapan dua pejabat Dinas Perhubungan DKI Jakarta sebagai tersangka oleh Kejaksaan Agung atas kasus pengadaan bus Transjakarta serta Bus Kota Terintegrasi Busway atau BKTB.</p>\r\n\r\n<p>&quot;Kedua tersangka ini hanya pelaksana saja. Ada otak dan pasti ada yang memerintah. Harusnya, ini yang jadi target kejaksaan,&quot; ujarnya kepada Kompas.com pada Selasa (31/3/2014) pagi.</p>\r\n\r\n<p>FAKTA adalah lembaga swadaya masyarakat yang pertama kali melaporkan kasus dugaan korupsi pengadaan bus tersebut ke Komisi Pemberantasan Korupsi (KPK). Kedua tersangka itu adalah DA, pejabat pembuat komitmen pengadaan bus, peremajaan angkutan umum reguler dan kegiatan pengadaan armada bus Transjakarta, dan ST, ketua panitia pengadaan barang/jasa bidang pekerjaan konstruksi 1 Dinas Perhubungan DKI Jakarta</p>\r\n\r\n<p>&quot;Kedua tersangka ini merekayasa lelang untuk siapa? Atas permintaan dan perintah siapa? Itu tugas kejaksaan untuk mengungkapnya,&quot; lanjutnya.</p>\r\n\r\n<p>Menangkap aktor intelektual dalam kasus tersebut, lanjut Tigor, punya dampak positif terhadap citra korps Adhyaksa tersebut. Menurutnya, publik telah menilai bahwa kinerja kejaksaan kurang &#39;greget&#39; dalam menyelesaikan kasus korupsi. Banyak kasus yang hanya berhenti di anak buah, sedangkan pimpinan masih bebas.</p>\r\n\r\n<p>&quot;Para koruptor, selama ini menghindar dari jeratan KPK (Komisi Pemberantasan Korupsi) dan lebih suka ditangani oleh kejaksaan. Sudah umumlah kalau kejaksaan mudah sekali SP3-nya,&quot; ujarnya.&nbsp;</p>\r\n\r\n<p>SP3 adalah Surat Perintah Penghentian Penyidikan. SP3 dikeluarkan jika penyidik, baik itu kepolisian, Kejaksaan atau penegak hukum lainnya tidak menemukan bukti atau bukti belum cukup dalam proses penyidikan sebuah kasus.&nbsp;</p>\r\n\r\n<p>Sebelumnya diberitakan, tim jaksa penyidik pidana khusus Kejagung menetapkan dua pejabat Dishub DKI, DA dan ST, sebagai tersangka terkait kasus dugaan korupsi pengadaan unit transjakarta di Dishub DKI tahun anggaran 2013.&nbsp;</p>\r\n\r\n<p>Berawal dari Foto&nbsp;</p>\r\n\r\n<p>Kasus bus berkarat berawal dari temuan foto-foto komponen bus Transjakarta dan BKT rusak oleh Kompas.com. Temuan itu menunjukan, lima dari 90 bus Transjakarta dan 10 dari 18 BKTB-semuanya bus baru-mengalami kerusakan pada beberapa komponennya. Misalnya, banyak komponen berkarat, berjamur dan beberapa instalasi tampak tidak dibaut. Bahkan, ada bus yang tidak dilengkapi dengan fanbelt mesin dan AC.&nbsp;</p>\r\n\r\n<p>Kondisi itu memicu tidak beroperasinya sejumlah unit bus usai diluncurkan Jokowi beberapa waktu lalu itu. Banyak mesin bus yang cepat panas, mesin sulit dinyalakan, proses kelistrikan sulit karena korosi di kepala aki. Bahkan, ada bus yang tabung apar pendingin mesinnya tiba-tiba meledak dan persoalan lain.</p>\r\n\r\n<p>Usut punya usut, rupanya ditemukan juga kejanggalan dalam proses pengadaan bus. Pihak yang mendatangkan bus, yakni PT San Abadi, bukan pemenang tender. Terungkap bahwa PT San Abadi merupakan subkontrak PT Saptaguna Dayaprima, satu dari lima pemenang tender. Hal ini dipertanyakan, mengingat situasi demikian memungkinkan adanya mark up anggaran tender.&nbsp;</p>\r\n\r\n<p>Pemeriksaan Inspektorat DKI Jakarta menyimpulkan ada dugaan penyimpangan pengadaan bus. Misalnya, spesifikasi teknis serta gambar yang disusun BPPT tak dikaji ulang oleh Dishub Jakarta. Selain itu, Dishub Jakarta juga hanya menyurvei harga perkiraan sendiri (HPS) ke peserta lelang tanpa pembanding dari merek lain.&nbsp;</p>\r\n\r\n<p>Tidak hanya itu, banyak peserta lelang yang tidak melampirkan metode kerja dan sertifikasi ISO 9001. Padahal, kedua hal itu adalah syarat pengadaan bus. Data terbaru, sejak awal bus transjakarta diluncurkan pada 2004, tabung bahan bakar yang dipakai tak layak. Gara-gara kasus tersebut, Kepala Dishub DKI Udar Pristono dicopot dari jabatannya. Dia dipindahtugaskan ke Tim Gubernur untuk Percepatan Pembangunan&nbsp;</p>\r\n', '', '', '', '', '', '', '', 'Fauzan', '20150126123554lkpp_transjakarta.jpg', 0, '', 0, '0000-00-00', '0000-00-00 00:00:00', '', 'Publish', 0, '0000-00-00 00:00:00', 1, 1, '2015-01-26 22:56:18', '2014-10-09 14:43:02', 14),
(21, 1, 'Hindari Korupsi Pengadaan Barang, Kejagung Buka Layanan Online', '<p>Guna mengantisipasi korupsi pengadaan barang dan jasa, Kejaksaan Agung (Kejagung) membuka Layanan Pengadaan Secara Elektronik (LPSE) dan Unit Layanan Pengadaan (ULP). Hal itu dibentuk agar proses pengadaan barang atau jasa di lingkungan korps Adhyaksa itu dapat terlaksana dengan profesional, bebas dari intervensi, kolusi, korupsi dan nepotisme.</p>\r\n\r\n<p>&quot;Tujuan pembentukan ini untuk membangun sistem yang dapat meminimalisir terjadinya penyimpangan atau kekeliruan dalam pelaksanaan pengadaan barang dan jasa. Sehingga menciptakan pelaksanaan pengadaan yang bernilai tinggi, dengan biaya yang ekonomis melalui tahapan yang efektif dan efisien, persaingan yang sehat, terbuka dan transparan,&quot; kata Kepala Biro Perencanaan Kejagung Agus Rismanto saat launching LPSE dan UPL di Gedung Kejagung, Jakarta, Rabu (2/4/2014).</p>\r\n\r\n<p>Agus menjelaskan, lembaga LPSE dan ULP diwujudkan pada 5 April 2012 dengan melakukan MoU dengan Sekjen Kementerian Keuangan. Penandatanganan kerja sama itu dimaksudkan agar pelaksanaan pengadaan dapat diwujudkan secara nasional, sehingga kejaksaan memanfaatkan fasilitas LPSE Kemenkeu.</p>\r\n\r\n<p>&quot;Kejaksaan mencoba memandirikan keberadaan LPSE dengan membangun infrastruktur yang dibutuhkan. Sehingga benar-benar dapat dan mampu memberikan pelayanan yang baik untuk ULP atau PPK dan penyedia barang atau jasa,&quot; klaim Agus.</p>\r\n\r\n<p>Menurut Agus, LPSE merupakan sarana untuk melaksanakan proses pengadaan secara elektronik, atau e-procurement secara online melalui internet. Upaya ini dinilai solusi tepat. Sarana ini akan mendapat pengawasan langsung dari masyarakat, sehingga diharapkan dapat terhindar dari penyimpangan.</p>\r\n\r\n<p>Kapuspenkum Kejagung Setia Untung Arimuladi mengatakan, saat ini ULP tengah menangani 6 paket pengadaan yang sedang berjalan. Di antaranya paket Meubelair Gedung Asrama Putri Badan Diklat, paket jasa Konsultasi pemiliharaan dan penyempurnaan perangkat lunak aplikasi dan basis data simkari.</p>\r\n\r\n<p>Selain itu ada juga paket pemiliharaan dan perbaikan keras Simkari, pengadaan obat-obatan umum dan gigi pada badan diklat, paket pengadaan general check up atau tes kesehatan bagi peserta Pendidikan dan Pelatihan Pembentukan Jaksa (PPPJ) tahun 2014, dan pengadaan sewa internet Link Adyaksa Center.</p>\r\n\r\n<p>Dalam acara launcing LPSE dan ULP itu dihadiri Wakil Jaksa Agung Andhi Nirwanto, perwakilan kejaksaan tinggi seluruh Indonesia, Komisi III DPR, dan perwakilan Lembaga Kebijakan Pengadaan Barang/Jasa Pemerintah (LKPP), Kementerian Keuangan, Kementerian Pendayagunaan Aparatur Negara dan Reformasi Birokrasi (PAN dan RB).</p>\r\n\r\n<p>Tak hanya itu, acara ini juga dihadiri Unit Kerja Presiden Bidang Pengawasan dan Pengendalian Pembangunan (UKP4), Badan Perencanaan Pembangunan Nasional (Bappenas), Badan Pemeriksa Keuangan (BPK), Badan Pengawasan Keuangan dan Pembangunan (BPKP), Asosiasi Pengusaha Indonesia dan Komisi Kejaksaan.</p>\r\n', '', '', '', '', '', '', '', 'Rizky', '20150126124131lkpp_kejagung.jpg', 0, '', 0, '0000-00-00', '0000-00-00 00:00:00', '', 'Publish', 0, '0000-00-00 00:00:00', 1, 1, '2015-01-26 22:56:01', '2014-11-06 13:39:07', 58);
